import React from "react";
import "./Nav-item.styles.scss";
import { useNavigate } from "react-router-dom";

const NavItem = ({ item, dropDownItems }) => {
  const navigate = useNavigate();
  let path = item.toLowerCase();
  console.log(dropDownItems);
  return (
    <li
      className={`nav-item ${path} {dropDownItems ? 'dropdown' : ''}`}
      style={{ cursor: "pointer" }}
      onClick={() => navigate(`/${path}`)}
    >
      {dropDownItems != "" ? (
        <a
          className="nav-link dropdown-toggle"
          href="#"
          id="navbarDropdown"
          role="button"
          data-toggle="dropdown"
          aria-haspopup="true"
          aria-expanded="false"
        >
          {item}
        </a>
      ) : (
        <a className="nav-link">{item}</a>
      )}
      {console.log(dropDownItems)}
      {dropDownItems != "" ? (
        <div className="dropdown-menu">
          {dropDownItems.map((ele) => (
            <a className="dropdown-item">ele </a>
          ))}
        </div>
      ) : (
        ""
      )}
    </li>
  );
};

export default NavItem;
